25-07-04 07:57:06.189675',NULL,'2025-07-04 07:57:06.189675','1000002','2025-04-11 17:00:00.000000','2025-04-01 17:00:00.000000','2025-03-29 17:00:00.000000',20,'Hiện thực chức năng cho đơn hành  và thanh toán','792e6f85-582a-4f65-a50d-e7c59cefb7b2','<p>- Hiện thực giỏ hàng</p><p>- Tạo đơn hàng, ghi nhận lại các thông tin người nhận và không được thay đổi</p><p>- Lấy địa chỉ tỉnh thành, có thể lựa chọn tính giá vận chuyển</p><p>- Tích hợp thanh toán của ví điện từ phổ biến</p><p>- Trang quản lý đơn hàng cho khách hàng và admin</p><p>- Admin được thay đổi trạng thái đơn hàng với các ràng buộc</p>'),('fb4952a3-6fbb-416b-92b3-d13f835e0de6','1000004',_binary '\0',NULL,'2025-08-03 07:46:04.151066',NULL,'2025-08-03 07:46:14.593097','1000004','2025-05-02 17:00:00.000000','2025-04-23 17:00:00.000000','2025-04-19 17:00:00.000000',10,'Tối ưu các mẫu đã hiện thực','86a434ee-075e-406a-9098-aea8d4ae86f0','<p>- Tối ưu các mẫu đã áp dụng vào chức năng</p>'),('fca63275-f3b3-4839-b287-a8b7474dd393','1000004',_binary '\0',NULL,'2025-08-03 07:42:38.390182',NULL,'2025-08-03 07:42:38.390182','1000004','2025-04-04 17:00:00.000000','2025-04-02 17:00:00.000000','2025-03-29 17:00:00.000000',8,'Học và ứng dụng Template Method và Visitor pattern','86a434ee-075e-406a-9098-aea8d4ae86f0','<p>- Chọn chức năng phù hợp với mẫu và hiện thực</p><p>- Ghi tài liệu</p>');
