INSERT INTO `workspaces` VALUES ('139b821a-f5d0-49c8-9f26-da68e54d59a2','1000003',_binary '\0',NULL,'2025-07-04 08:16:02.078012',NULL,'2025-07-04 08:16:02.078012','1000003','<p>- Có các kiến thức cơ bản về lập trình thiết bị di động nói chung và android nói riêng</p><p>- Các kỹ thuật xây dựng giao diện băng XML, các mẫu thiết kế cho android</p><p>- Xây dựng ứng dung với các API của hệ điều hành thuộc Android bằng ngôn ngữ Java</p>','2025-04-25 17:00:00.000000','Thực tập Lập trình trên Thiết bị di động','2025-02-08 17:00:00.000000','f3ee7d4d-d82b-45d8-8c46-6756b1b6ea81','a15b3c2e-54c1-11f0-b992-0242ac150005'),('26b84f37-a0bb-4d11-8cc4-785e7707dfbb','1000005',_binary '\0',NULL,'2025-07-29 14:33:23.566173',NULL,'2025-07-29 14:33:23.566173','1000005','<p><br></p>','2025-08-18 14:32:57.165000','Lập trình Web 2025','2025-07-29 14:32:57.165000','f3ee7d4d-d82b-45d8-8c46-6756b1b6ea89','a15b3bbe-54c1-11f0-b992-0242ac150005'),('3d4c23db-a9f0-41d2-aa6e-5254b7f48277','1000005',_binary '\0',NULL,'2025-07-04 08:50:29.504689',NULL,'2025-07-04 08:50:29.504689','1000005','<p>- Xây dựng các ứng dụng web-based dựa trên 2 công nghệ Servlet và JSP trong J2EE framework</p><p>- Bộ thẻ JSTL, giúp cải tiến code cho các trang JSP</p><p>- Mô hình MVC, kết hợp 2 công nghệ Servlet và JSP</p><p>- Hiện thực các chức năng cơ bản đối với website bán hàng, các chức năng nghiệp vụ đối với các bài toàn khác nhau</p>','2025-05-14 17:00:00.000000','Thực tập Lập trình WEB','2025-03-08 17:00:00.000000','f3ee7d4d-d82b-45d8-8c46-6756b1b6ea89','a15b3bbe-54c1-11f0-b992-0242ac150005'),('7271fe01-d53f-498f-9d87-2042d6f524ab','1000004',_binary '\0',NULL,'2025-07-04 08:30:52.051959',NULL,'2025-07-04 08:30:52.051959','1000004','<p>- Nắm được 4 nguyên tắc chính trong OOP</p><p>- Hiểu biết cơ bản về 12 mẫu thiết kế và mô hình MVC trong phát triển ứng dụng</p><p>- Có khả năng ứng dụng mẫu vào ứng dụng</p><p>- Có khả năng thiết kế Class diagram và kết hợp nhiều mẫu thiết kế với nhau</p>','2025-05-09 17:00:00.000000','Thiêt kế hướng đối tượng','2025-02-08 17:00:00.000000','f3ee7d4d-d82b-45d8-8c46-6756b1b6ea87','a15b3a4e-54c1-11f0-b992-0242ac150005'),('792e6f85-582a-4f65-a50d-e7c59cefb7b2','1000002',_binary '\0',NULL,'2025-07-04 06:32:20.288462',NULL,'2025-07-04 06:32:20.288462','1000002','<p>- Có các kiến thức cơ bản về Website thương mại điện từ</p><p>- Hiểu biết về các khái niệm, kỹ thuật và mô hình mà các sàn thương mại điện tử hiện nay đang áp dụng</p><p>- Kiến thức để tự lên kế hoạch cho quá trinh xây dựng thương mại điện tử</p><p>- Sản phẩm website thương mại điện tử</p>','2025-04-26 17:00:00.000000','Thương mại điện tử','2025-02-09 17:00:00.000000','f3ee7d4d-d82b-45d8-8c46-6756b1b6ea79','a15b5475-54c1-11f0-b992-0242ac150005'),('86a434ee-075e-406a-9098-aea8d4ae86f0','1000004',_binary '\0',NULL,'2025-08-03 06:53:58.112512',NULL,'2025-08-03 06:53:58.112512','1000004','<p>- Nắm được 4 nguyên tắc chính trong OOP</p><p>- Hiểu biết cơ bản về 12 mẫu thiết kế và mô hình MVC trong phát triển ứng dụng</p><p>- Có khả năng ứng dụng mẫu vào ứng dụng</p><p>- Có khả năng thiết kế Class diagram và kết hợp nhiều mẫu thiết kế với nhau</p>','2025-05-09 17:00:00.000000','Thiết kế hướng đối tượng 2025','2025-02-08 17:00:00.000000','f3ee7d4d-d82b-45d8-8c46-6756b1b6ea87','a15b3a4e-54c1-11f0-b992-0242ac150005'),('88e830a7-f240-4d0f-b8f3-bd08cfb69607','1000001',_binary '\0',NULL,'2025-07-04 04:55:18.335657',NULL,'2025-07-04 04:55:18.335657','1000001','<p>- Có kiến thức cơ bản về Machine Learning chung</p><p>- Hiểu biết cơ bản về các mô hình phổ biến như SVM, CNN, Logistic Regression, Linear Regression</p><p>- Phân loại được các bài toán liên quan Machine Learning như dự đoán, phân loại, học tăng cường</p><p>- Có khả năng đánh giá được mô hình theo nhiều khía cạnh</p><p>- Hiểu biết về quy trình giải quyết bài toán liên quan đến Machine Learning</p><p>- Có khả năng xử dụng ngôn ngữ Python để xử dụng các thư viện cho việc xử lý dữ liệu và sử dụng mô hình Machine Learning</p>','2025-04-19 17:00:00.000000','Machine Learning','2025-02-09 17:00:00.000000','f3ee7d4d-d82b-45d8-8c46-6756b1b6ea69','a15b3eee-54c1-11f0-b992-0242ac150005'),('f228ad1b-f250-41b6-ab6e-7979a8c78a52','1000001',_binary '\0',NULL,'2025-07-23 17:00:19.776077',NULL,'2025-07-23 17:00:19.776077','1000001','<p>Môn học cung cấp cho sinh viên các kiến thức về:</p><ol><li data-list=\"bullet\"><span class=\"ql-ui\" contenteditable=\"false\"></span>Các khái niệm về máy học</li><li data-list=\"bullet\"><span class=\"ql-ui\" contenteditable=\"false\"></span>Các bài toán phổ biến liên quan đến máy học như Phân loại, Hồi Quy, Gom cụm</li><li data-list=\"bullet\"><span class=\"ql-ui\" contenteditable=\"false\"></span>Các kiến thức về tiền xử lý dữ liệu</li><li data-list=\"bullet\"><span class=\"ql-ui\" contenteditable=\"false\"></span>Kiến thức cơ bản về Python và cách sử dụng API của các thư viên máy học</li></ol>','2025-05-04 17:00:00.000000','Machine Learning 2025','2025-02-08 17:00:00.000000','f3ee7d4d-d82b-45d8-8c46-6756b1b6ea69','a15b3eee-54c1-11f0-b992-0242ac150005');
